import React from "react";
import { NavLink } from "react-router-dom";
function MyLearningOne() {
  return (
    <>
      <ul className="tracks">
        <li className="track_item">
          <NavLink to="/frontend" className="track_Link">
            TRACK-1 (FRONTEND)
          </NavLink>
        </li>
        <li className="track_item">
          <NavLink to="/frontend" className="track_Link">
            TRACK-2 (BACKEND)
          </NavLink>
        </li>
        <li className="track_item">
          <NavLink to="/frontend" className="track_Link">
            TRACK-3 (DATABASE)
          </NavLink>
        </li>
      </ul>
    </>
  );
}

export default MyLearningOne;
